CREATE FUNCTION public.get_latest_campaign(p_name text, p_created_by uuid DEFAULT NULL::uuid, p_version integer DEFAULT NULL::integer) RETURNS public.campaigns
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_campaign campaigns;
  v_user_id UUID;
BEGIN
  -- Use provided user or current user
  v_user_id := COALESCE(p_created_by, auth.uid());
  
  IF p_version IS NULL THEN
    -- Get latest version
    SELECT * INTO v_campaign
    FROM campaigns
    WHERE name = p_name 
      AND created_by = v_user_id
    ORDER BY version DESC
    LIMIT 1;
  ELSE
    -- Get specific version
    SELECT * INTO v_campaign
    FROM campaigns
    WHERE name = p_name 
      AND created_by = v_user_id
      AND version = p_version;
  END IF;
  
  RETURN v_campaign;
END;
$$;


