    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_latest_version INT;
  v_new_version INT;
BEGIN
  -- Get latest version
  SELECT COALESCE(MAX(version), 0) 
  INTO v_latest_version
  FROM campaigns 
  WHERE name = p_name AND created_by = p_created_by;

  v_new_version := v_latest_version + 1;

  -- Insert new version
